        content:
            '\u300cBread\u300d\u3068\u3044\u3046\u5faa\u74b0\u30d3\u30fc\u30eb\u306e\u30d7\u30ed\u30b8\u30a7\u30af\u30c8\u306b\u95a2\u308f\u3063\u3066\u308b\u4eba\u6c17\u306a\u30d9\u30fc\u30ab\u30ea\u30fc\u3002\u30d7\u30e9\u30f3\u30c8\u30d9\u30fc\u30b9\u306e\u30d1\u30f3\u306f\u8868\u793a\u3055\u308c\u3066\u307e\u3059\u3002\u5546\u54c1\u306e\u7d04\u534a\u5206\u304c\u30d7\u30e9\u30b9\u30c1\u30c3\u30af\u30d5\u30ea\u30fc\u3002\u30d7\u30e9\u30b9\u30c1\u30c3\u30af\u30d5\u30ea\u30fc\u306e\u30b0\u30e9\u30ce\u30fc\u30e9\u306a\u3069\u3082\u8ca9\u58f2\u3057\u3066\u3044\u308b\u3002\u30b3\u30fc\u30d2\u30fc\u30b7\u30e7\u30c3\u30d7\u3067\u306f\u3001\u30aa\u30fc\u30c8\u30df\u30eb\u30af\u3092\uff0b100\u5186\u3067\u8ca9\u58f2\u3057\u3066\u3044\u307e\u3059\u3002\u30de\u30a4\u30ab\u30c3\u30d7\u3084\u30d1\u30f3\u306e\u888b\u3092\u6301\u53c2\u3059\u308b\u306810\u5186\u5f15\u304d\u306b\u306a\u308a\u307e\u3059\u3002Bricolage bread \uff06 co.\u306f\u3001\u30a2\u30d7\u30ea\u3067\u7ba1\u7406\u3059\u308b\u52a0\u76df\u5e97\u3067\u8cb8\u3057\u501f\u308a\u3067\u304d\u308b\u30ea\u30e6\u30fc\u30b9\u30ab\u30c3\u30d7\u30b5\u30fc\u30d3\u30b9\u300cCUPLES\u300d\uff08@cuples_japan\uff09\u306b\u3082\u52a0\u76df\u3057\u3066\u3044\u308b\u305d\u3046\u3067\u3059\u3002\r\n\r\nA popular bakery involved in a circular beer brand project called "bread". Their plant-based bread are clearly identified. About half of their products are plastic free. They also sell plastic free granola and other food products in glass jars. For the coffee shop, oat milk is available for an extra 100 yen. They give 10 yen discount if you bring your own cup or bread bag. Bricolage bread &amp; co. is also a member of "CUPLES", a service of reusable cups that can be borrowed and returned at member stores managed through an app (@cuples_japan).\r\n\r\n\u3012106-0032 \u6771\u4eac\u90fd\u6e2f\u533a\u516d\u672c\u6728\uff16\u4e01\u76ee\uff11\uff15\u22121 \u3051\u3084\u304d\u5742\u30c6\u30e9\u30b91F\r\n\r\nInstagram: <a href="https://www.instagram.com/bricolage_bread_and_company/">@bricolage_bread_and_company</a>, <a href="https://www.instagram.com/bricolage_bread_and_co.ffee/">@bricolage_bread_and_co.ffee</a>',
