        content:
            '\u5168\u56fd\u5404\u5730\u306e\u76f4\u63a5\u5951\u7d04\u8fb2\u5bb6\u304b\u3089\u9001\u3089\u308c\u3066\u304f\u308b\u65b0\u9bae\u306a\u91ce\u83dc\u30fb\u304a\u7c73\u3092\u306f\u3058\u3081\u3001\u7121\u6dfb\u52a0\u306e\u8abf\u5473\u6599\u3001\u304a\u5f01\u5f53\u30fb\u304a\u60e3\u83dc\u3001\u624b\u4f5c\u308a\u30d1\u30f3\u306a\u3069\u7f8e\u5473\u3057\u304f\u5b89\u5fc3\u5b89\u5168\u306a\u98df\u6750\u304c\u305d\u308d\u3046\u304a\u5e97\u3067\u3059\u3002\r\n\r\nF and F Safety Standard\r\nWe handle products that do not use chemically synthesised additives.\r\nWe mainly use domestic raw materials, and if there are no domestic products, we will give priority to overseas products (BIO, organic). We purchase agricultural products cultivated with as little chemical pesticides and fertilisers as possible. We do not handle foods that mainly use genetically modified agricultural products.\r\n\r\nDirect contract with farmer\r\nWe purchase vegetables grown directly from the production area from contract farmers (about 200) all over the country without using pesticides and chemical fertilisers as much as possible. It is fresh and full of the original taste of vegetables. In addition, we contract with rice farmers nationwide to consistently perform harvesting, sorting, sorting, bagging, and delivery, and we try not to mix any other rice.\r\n\r\nOriginal product * PB product\r\nAt F and F, the factories within the group manufacture lunch boxes and side dishes, natural yeast bread, cakes and baked goods made from carefully selected ingredients, easy-to-cook retort sauces, and frozen foods, and are full of original products.\r\nIn addition, we go directly to overseas (Italy and India) such as organic spaghetti and Darjeeling tea to determine the quality, and then purchase and sell the finest organic foods without going through any trading company.\r\n\r\n106-0047 \u6771\u4eac\u90fd\u6e2f\u533a\u5357\u9ebb\u5e03\uff15\u4e01\u76ee\uff11\uff15\u221220 \u5357\u9ebb\u5e03\u30d5\u30e9\u30ef\u30fc\u30de\u30f3\u30b7\u30e7\u30f3 1F',
